import React from 'react';
import { Chart as ChartJS, ArcElement, Tooltip, Legend } from 'chart.js';
import { Doughnut } from 'react-chartjs-2';


function WinsByColorDonut(cumulativeData) {
    ChartJS.register(ArcElement, Tooltip, Legend);


    const labels = Object.keys(cumulativeData.games_by_color.white)
    let data = {
        labels,
        datasets: [
          {
            label: 'White',
            data: Object.values(cumulativeData.games_by_color.white),
            backgroundColor: [
                'rgb(75, 192, 192)',
                'rgb(255, 99, 132)',
                'rgb(53, 162, 235)'
            ],
            borderColor: [
                'rgb(75, 192, 192)',
                'rgb(255, 99, 132)',
                'rgb(53, 162, 235)'
            ],
            borderWidth: 1,
          },
        ],
      };

  return (
    <div>WinsByColorDonut</div>
  )
}

export default WinsByColorDonut;
